import React from 'react'
import { Parallax, Background } from 'react-parallax';

const image = "./assets/background.jpg";

export const Contact = () => (
    <div>
        <Parallax 
            bgImage= { image }>
                <div style={{ height: 500 }}>
                    <div>HTML INSIDE PARALLAX</div>
                </div>
        </Parallax>
   </div>
)
